description:
Movie Info: Rabba Main Kya Karoon is 2013 Hindi Romantic Comedy film directed by Amrit Sagar Chopra and produced by Moti Sagar. The film features Akash Chopra, Arshad Warsi, Paresh Rawal, Tahira Kocchar and Riya Sen as main characters.


